import React, { useState, useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { useNavigate } from 'react-router-dom';
import { getLog } from '../../store/action/addLogIn_'
import style from './logStyle.module.css';


export default function Log_in() {
  const login = useSelector((state) => state.logIn)
  console.log('LOGIN=====>', login);
  const dispatch = useDispatch();

  const [name, setName] = useState("");
  const [password, setPassword] = useState("");
  const [messege, setMessege] = useState("");

  const nameHandler = (e) => {
    setName(e.target.value);

  };
  const passwordHandler = (e) => {
    setPassword(e.target.value);

  };

  const navigate = useNavigate();

  const logInNow = async (e) => {

    try {
      if (password.length >= 8 && name.length > 0) {
        e.preventDefault()
        dispatch(getLog(name, password));
      } else {setMessege ("Пароль должен быть не менее 8 символов. Поле -ИМЯ- не может быть пустым") }



      // navigate('/coockcabinet');
    } catch (error) {

    }
  };


  return (
    <div className={style.box}>

      <form className={style.form}>
        <h5>   </h5>

        <div className={style.inputdiv}>
          <input
            name='name'
            className={style.inputs}
            type="text"
            placeholder="Введите ваше имя"
            value={name}
            onChange={(e) => nameHandler(e)}
          />
        </div>

        <div className={style.inputdiv}>
          <input
          name='password'
          className={style.inputs}
          type="password"
          placeholder="Пароль"
          value={password}
          onChange={(e) => passwordHandler(e)}
          />
        </div>

        <button type='submit' className={style.button} onClick={logInNow} >Войти</button>

      </form>

    </div>
  )
}
